                bgImageAlt="the mem"
                strength={500}
                >
                <div className="flex h-[70vh] justify-center rounded-lg items-center">
                    <p className="text-6xl text-white tracking-widest mt-[60px] thermite pb-2">
                    UPCOMING EVENTS
                    </p>
                </div>
                </Parallax>
            </div>
            <div>
                <div className="text-center text-4xl thermite text-[#183557] mb-[]">title</div>
            </div>
        </div>
    )
}

export default RenderNews;
